import React, {Component} from 'react';
//dependencias de material ui React components that implement Google's
import { AppBar, Toolbar, Typography, } from '@material-ui/core';
import { withStyles } from '@material-ui/core/styles';
import {MenuIcon}from '@material-ui/icons/Menu';
import propTypes from 'prop-types';
import { styles} from '../styles/Navegation';


class Navegation extends Component{

  render(){
    const { classes } = this.props;
    let content = (
      <div className={classes.root}>
        <AppBar position="static" style={{ backgroundColor: ' #fd5800' }} >
          <Toolbar>
            <IconButton className={classes.menuButton} color="inherit" aria-label="Menu">
              <MenuIcon/>
            </IconButton>
            <Typography  variant="h6" color="inherit">
              Capitalize
            </Typography>
          </Toolbar>
        </AppBar>
      </div>
    );

    return content;
  }
}
Navegation.propTypes = {
  classes: propTypes.object.isRequired,
};
export default withStyles(styles)(Navegation);
